  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114641 includes meteorological,
  biological and trawl data collected aboard the CHARTER/FISHING BOATS during cruises
  FR0206-01, FR0206-02, FR0208, SE0005 and SE0007 in the North Pacific Ocean from
  2000-05-29 to 2002-08-18. These data include WATER DEPTH, SPECIES IDENTIFICATION,
  SPECIES IDENTIFICATION - LIFE STAGE, species abundance and SPECIES IDENTIFICATION
  - WET WEIGHT. The instruments used to collect these data include trawl. These data
  were collected by Suzan S Pool of Oregon State University and Richard D Brodeur
  and Robert L Emmett of Northwest Fisheries Science Center - Newport as part of NEP.
  The Biological and Chemical Oceanography Data Management Office (BCO-DMO) submitted
  these data to NODC on 2013-10-31.nnThe following is the text of the abstract provided
  by BCO-DMO:nnU.S. GLOBEC Northeast Pacific California Current System Mesoscale Process
  StudiesnTrawl Catch DatanContacts for this data set are:nDr. Richard BrodeurnNorthwest
  Fisheries Science CenternNational Oceanographic and Atmospheric AdministrationnNewport,
  OR 97365nPhone: 541-867-0336nEmail: Rick.Brodeur@noaa.govnRobert EmmettnNorthwest
  Fisheries Science CenternNational Oceanographic and Atmospheric AdministrationnNewport,
  OR 97365nPhone: 541-867-0109nEmail: Robert.Emmett@noaa.govnSuzan PoolnCooperative
  Institute of Marine Resources StudiesnOregon State UniversitynNewport, OR 97365nPhone:
  541-867-0195nEmail: Suzan.Pool@noaa.govnDuring juvenile salmonid trawling cruises,
  additional sampling included CTD profiles, neuston net tows, and Niskin bottle water
  collections for chlorophyll a. At most stations, data on all parameters were collected.nResults:
  Detailed analyses of the nekton trawl catches for 2000 are presented in Brodeur
  et al. (2004) and for jellyfish for both years in Suchman and Brodeur (2005).nReferencesnBrodeur,
  R. D., J. P. Fisher, D. J. Teel, R. L. Emmett, E. Casillas, and T. W. Miller. 2004.
  Juvenile salmonid distribution, growth, condition, origin, and environmental and
  species associations in the Northern California Current. Fish. Bull. 102: 25-46.nSuchman,
  C. L. and R. D. Brodeur. 2005. Abundance and distribution of large medusae in surface
  waters of the northern California Current. Deep-sea Res. II. 52(1- 2):51-72.nLast
